class Solution:
    def findRadius(self, houses: list[int], heaters: list[int]) -> int:
        houses.sort()
        heaters.sort()

        p_house, p_heater = 0, 0
        max_radius = 0
        for house in houses:
            # if abs(house - heaters[p_heater]) > max_radius:
            #     if house > heaters[p_heater] and p_heater + 1 < len(heaters) and abs(house - heaters[p_heater + 1]) > max_radius:
            #         if abs(house - heaters[p_heater]) >= abs(house - heaters[p_heater + 1]):
            #             max_radius = abs(house - heaters[p_heater + 1])
            #             p_heater += 1
            #         else:
            #             max_radius = abs(house - heaters[p_heater])
            #     elif house > heaters[p_heater] and p_heater + 1 < len(heaters) and abs(house - heaters[p_heater + 1]) <= max_radius:
            #         p_heater += 1
            #     else:
            #         max_radius = abs(house - heaters[p_heater])

            if abs(house - heaters[p_heater]) > max_radius:
                while p_heater + 1 < len(heaters):
                    if abs(house - heaters[p_heater]) >= abs(house - heaters[p_heater + 1]):
                        p_heater += 1
                    else:
                        break
                max_radius = max(max_radius, abs(house - heaters[p_heater]))

        return max_radius


